column7:
Hola Chicos, no sé si hay alguien por aca. Estoy trabado con el bonfire "reverse a string" y no puedo solucionarlo. Si alguien me da una mano, les agradecería. ete aquí mi código:
```
function reverseString(str) {
  var strReverse = str.split(" ").reverse().join(" ");
  return strReverse;
}

reverseString('hello');
```
